import React, { useState } from "react";
import axios from "axios";

function ProjectForm() {
  const [name, setName] = useState("");
  const [description, setDescription] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();
    axios.post("http://localhost:8080/api/project/create", {
      name,
      description,
      project_status,

    }).then(() => {
      alert("✅ Proje kaydedildi!");
      setName("");
      setDescription("");
      setProject_Status("");
    });
  };

  return (
    <div>
      <h3>➕ Proje Ekle</h3>
      <form onSubmit={handleSubmit}>
        <input value={name} onChange={(e) => setName(e.target.value)} placeholder="Proje Adı" />
        <input value={description} onChange={(e) => setDescription(e.target.value)} placeholder="Açıklama" />
        <input value={project_status} onChange={(e) => setName(e.target.value)} placeholder="Proje Durumu" />
        <button type="submit">Kaydet</button>
      </form>
    </div>
  );
}

export default ProjectForm;
